import { Card, Space } from "antd";

function TestCard() {
  return (
    <div>
      <Card
        headStyle={{
          color: "white",
          background: "#3E3D40",
        }}
        title={
          <div>
            <b>SSID: </b>Aegis Research
          </div>
        }
        style={{
          width: "100%",
          overflow: "hidden",
          color: "white",
          margin: "0 auto",
        }}
        bodyStyle={{ background: "#1F1E26" }}
      >
        <Space size={20}>
          <p>Device Status:</p>{" "}
          <p>
            <b>ACTIVE</b>
          </p>
        </Space>
        <br />
        <p>
          Device Type: <b>WorkStation PC</b>
        </p>
        <p>
          OS Version: <b>Windows 10 Enterprise</b>
        </p>
        <p>
          MAC Address: <b>aa:bb:cc:dd:ee:ff</b>
        </p>
      </Card>
    </div>
  );
}

export default TestCard;
